{"title":"Directions_Markdown_WhereUserLoggedIn","type":"markdown","params":{"fontSize":12,"openLinksInNewTab":false,"markdown":"### Directions - Where was user X logged in?

To find user X you simply put in the string or strings you are looking for in the search bar. If you want to speed up your search specify a field. In this instance the valid fields are **user.id.keyword**, OR **user.name.keyword** .

So a valid query in the discover bar might be **user.name.keyword:jonsmith**"},"aggs":[]}

{"title":"Directions_Markdown_HowFindX","type":"markdown","params":{"fontSize":12,"openLinksInNewTab":false,"markdown":"### Directions - How do I find X?

To find X you simply put in the string or strings you are looking for in the search bar. If you want to speed up your search specify a field. In this instance the valid fields are **host.name.keyword**, **host.ip**, **user.id.keyword**, OR **user.name.keyword** .

So a valid query in the discover bar might be **host.name.keyword:windows7abc111**"},"aggs":[]}

